import React, { Component } from 'react';
import Layout from './../layouts/MainLayout';



class Index extends Component {



    
    render() { 
        
        const catageries = [
            {id:1 , topic: 'topic1', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=1'},
            {id:2 , topic: 'topic2', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=2'},
            {id:3 , topic: 'topic3', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=3'},
            {id:4 , topic: 'topic4', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=4'},
            {id:5 , topic: 'topic5', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=5'},
            {id:6 , topic: 'topic6', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=6'},
            {id:7 , topic: 'topic7', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=7'},
            {id:8 , topic: 'topic8', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=8'},
            {id:9 , topic: 'topic9', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=9'},
            {id:10 , topic: 'topic10', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=10'},
            {id:11 , topic: 'topic11', subtopic:'subtopic1',imageUrl:'http://loremflickr.com/320/150?random=11'}
            
        ]
          return ( 
            <Layout>
                <h1>testing2 </h1>
                <div className="container">
                <div className="row">
                {catageries.map(c=>
                    
                    <div className="col-sm-6 col-md-4 col-lg-3 mt-4">
                <div className="card">
                    <img className="card-img-top" src="https://picsum.photos/200/150/?random"/>
                    <div className="card-block">
                        <figure className="profile">
                            <img src="https://picsum.photos/200/150/?random" className="profile-avatar" alt=""/>
                        </figure>
                        <h4 className="card-title mt-3">Tawshif Ahsan Khan</h4>
                        <div className="meta">
                            <a>Friends</a>
                        </div>
                        <div className="card-text">
                            Tawshif is a web designer living in Bangladesh.
                        </div>
                    </div>
                    <div className="card-footer">
                        <small>Last updated 3 mins ago</small>
                        <button className="btn btn-secondary float-right btn-sm">show</button>
                    </div>
                </div>
        
                   
                    </div>
                )}
                    
                </div>
              
                </div>

                <style jsx>{
                    `h5 {
                        font-size: 1.28571429em;
                        font-weight: 700;
                        line-height: 1.2857em;
                        margin: 0;
                    }
                    
                    .card {
                        font-size: 1em;
                        overflow: hidden;
                        padding: 0;
                        border: none;
                        border-radius: .28571429rem;
                        box-shadow: 0 1px 3px 0 #d4d4d5, 0 0 0 1px #d4d4d5;
                    }
                    
                    .card-block {
                        font-size: 1em;
                        position: relative;
                        margin: 0;
                        padding: 1em;
                        border: none;
                        border-top: 1px solid rgba(34, 36, 38, .1);
                        box-shadow: none;
                    }
                    
                    .card-img-top {
                        display: block;
                        width: 100%;
                        height: auto;
                    }
                    
                    .card-title {
                        font-size: 1.28571429em;
                        font-weight: 700;
                        line-height: 1.2857em;
                    }
                    
                    .card-text {
                        clear: both;
                        margin-top: .5em;
                        color: rgba(0, 0, 0, .68);
                    }
                    
                    .card-footer {
                        font-size: 1em;
                        position: static;
                        top: 0;
                        left: 0;
                        max-width: 100%;
                        padding: .75em 1em;
                        color: rgba(0, 0, 0, .4);
                        border-top: 1px solid rgba(0, 0, 0, .05) !important;
                        background: #fff;
                    }
                    
                    .card-inverse .btn {
                        border: 1px solid rgba(0, 0, 0, .05);
                    }
                    
                    .profile {
                        position: absolute;
                        top: -12px;
                        display: inline-block;
                        overflow: hidden;
                        box-sizing: border-box;
                        width: 25px;
                        height: 25px;
                        margin: 0;
                        border: 1px solid #fff;
                        border-radius: 50%;
                    }
                    
                    .profile-avatar {
                        display: block;
                        width: 100%;
                        height: 100%;
                        border-radius: 50%;
                    }
                    
                    .profile-inline {
                        position: relative;
                        top: 0;
                        display: inline-block;
                    }
                    
                    .profile-inline ~ .card-title {
                        display: inline-block;
                        margin-left: 4px;
                        vertical-align: top;
                    }
                    
                    .text-bold {
                        font-weight: 700;
                    }
                    
                    .meta {
                        font-size: 1em;
                        color: rgba(0, 0, 0, .4);
                    }
                    
                    .meta a {
                        text-decoration: none;
                        color: rgba(0, 0, 0, .4);
                    }
                    
                    .meta a:hover {
                        color: rgba(0, 0, 0, .87);
                    `
                }</style>
                  </Layout>
           );
      }
    
}

export default Index;
